import Search from './search.jsx'
import './App.css';
import Leadmap from './map.js'

function App() {
  return (
    <div className="App">
      <p></p>
      <Search title="Street Address..." json="address"></Search> 
      <Search title="City..." json="city"></Search>
      <p></p>
      <Leadmap></Leadmap>
    </div>
  );
}

export default App;
